import React from 'react';

function CharactersCard({character}){
    const img = require("../../assets/Darth_Vader.jpg");
    console.log(process.env.PUBLIC_URL);
    return(
        <div className="character-cards-container" >

           <img src={img} />
           <div>{character}</div>
        </div>
    );
}

export default CharactersCard;
